import React from 'react';
import { Link } from 'react-router-dom';
// import Pdf from '../CSE_5335_FALL2023_Section3_103.pdf'
import SyllabusPdf from '../CSE_5335_FALL2023_Section3_103.pdf';
import NotesPdf from '../notes.pdf';
import DescPdf from '../desc.pdf'

function Student() {
    return (
        <div>
          <header>
            <h1>MS in DS Academic Program</h1>
          </header>
          <nav>
            <Link to="/Files">Files</Link>
            <Link to="/Grades">Grades</Link>
            <Link to="/Appointments">Appointments</Link>
            <Link to="/Messages">Messages</Link>
            <Link to="/">Logout</Link>
          </nav>
          <div className="container">
            <div className="content">
              <div className="dashboard">
                <div className="section">
                  <h2>CSE 5321-001</h2>
                  <a href={SyllabusPdf} target='_blank'>Syllabus</a>&nbsp;
                  <a href={NotesPdf} target='_blank'>Notes</a>&nbsp;
                  <a href={NotesPdf} target='_blank'>Description</a>&nbsp;
                </div>
                <div className="section">
                  <h2>CSE 5334-004</h2>
                  <a href={SyllabusPdf} target='_blank'>Syllabus</a>&nbsp;
                  <a href={NotesPdf} target='_blank'>Notes</a>&nbsp;
                  <a href={NotesPdf} target='_blank'>Description</a>&nbsp;
                </div>
                <div className="section">
                  <h2>CSE 6324-003</h2>
                  <a href={SyllabusPdf} target='_blank'>Syllabus</a>&nbsp;
                  <a href={NotesPdf} target='_blank'>Notes</a>&nbsp;
                  <a href={NotesPdf} target='_blank'>Description</a>&nbsp;
                </div>
              </div>
            </div>

          </div>
          <footer>
            <p>@ copyright MS in DS Academic Program</p>
          </footer>
        </div>
      );
    };

    export default Student;
